import axios from "axios";
function BeerList(props) {
  const[ phones, setPhones] = useState([]);


  // This effect depends on `props.projects`.
  // It will run on initial render and every time

  useEffect(() => {
    axios
      .get("http://localhost:5005/phones/")
      .then((response) => {

        setPhones([...response.data]);

      });
  }, []);





  console.log(phones)
  const mystyle = {
    color: "white",
    backgroundColor: "DodgerBlue",
    padding: "10px",
    fontFamily: "Arial",

    allignItem: "center",
    overflow: 'scroll',

  };
  console.log()
  return (
    <div style={{ display: 'flex', flexDirection: 'row' }}>

      <div className="col-5" style={{ mystyle }}>
        <div className="list-group" style={{ height: '600px', overflow: 'scroll' }}>

          {phones.map((phone) => {


            console.log("arr", phone)






            return (
              <div>
                <h6>{phone.name}</h6>
                <h6>Created By:</h6>
              </div>
            );

          })}




        </div>
      </div>
     </div>
  )
}

export default BeerList;
